import { createMultisigCreateInstruction } from "../generated";
export function multisigCreate({ creator, multisigPda, configAuthority, threshold, members, timeLock, createKey, memo, }) {
    return createMultisigCreateInstruction({
        creator,
        createKey,
        multisig: multisigPda,
    }, {
        args: {
            configAuthority,
            threshold,
            members,
            timeLock,
            memo: memo ?? null,
        },
    });
}
